static int getbits(uint8_t buffer[], int totbitoffset, int *info, int bytecount,
	    int numbits)
{
	int inf;
	int  bitoffset  = (totbitoffset & 0x07);/*bit from start of byte*/
	long byteoffset = (totbitoffset >> 3);/*byte from start of buffer*/
	int  bitcounter = numbits;
	static uint8_t *curbyte;

	if ((byteoffset) + ((numbits + bitoffset) >> 3) > bytecount){
        pr_info("!!! ERROR - PAST END OF DATA !!!\n");
		return -1;
    }

	curbyte = &buffer[byteoffset];
	bitoffset = 7 - bitoffset;
	inf = 0;

	while (numbits--) {
		inf <<= 1;
		inf |= ((*curbyte) >> (bitoffset--)) & 0x01;

		if (bitoffset < 0) {
			curbyte++;
			bitoffset = 7;
		}
	/*curbyte   -= (bitoffset >> 3);*/
	/*bitoffset &= 0x07;*/
	/*curbyte   += (bitoffset == 7);*/
	}

	*info = inf;
	return bitcounter;
}

